@Component({
  selector: 'app-footercc',
  templateUrl: './footercc.component.html',
  styleUrls: ['./footercc.component.css']
})
export class FooterccComponent {

}
<footer class="card text-bg-warning mb-3 fixed-bottom" style="max-width: 111.99rem;">
  <div class="card-header">Header</div>
  <div class="card-body">
    <h5 class="card-title">Danger card title</h5>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
  </div>
</footer>
